import React from 'react'
import {
    ModalHeader,
    ModalDescription,
    ModalContent,
    ModalActions,
    Button,
    Header,
    Image,
    Modal,
} from 'semantic-ui-react'

function DetailsModal({ toggleOpen, animalData, isOpen }) {
    const { name, age, gender, timeInShelter, breeds, description, attributes, photos, contact, colors, status, tags } = animalData || {}

    return (
        <Modal
            onClose={toggleOpen}
            onOpen={toggleOpen}
            open={isOpen}
            size="small"
            centered={false}
            style={{ top: '0%', left: '27%', height: 'fit-content' }}
            closeIcon={true}
        >
            <ModalHeader>Learn more about {name} </ModalHeader>
            <ModalContent image>
                <Image size='medium' src={photos?.['medium']} wrapped />
                <ModalDescription>
                    <Header> Time in shelter {timeInShelter} </Header>
                    <p>
                        {description}
                    </p>
                    {breeds?.primary && <div> Breed: {breeds['primary'] ?? breeds['primary']}  {breeds['secondary'] && `/ ${breeds['secondary']}`}</div>}
                    {gender && <div> Gender: {gender}</div>}
                    {age && <div> Age: {age}</div>}
                    {colors?.primary && <div> Color: {colors['primary']} {colors['secondary'] && `/ ${colors['secondary']}`} {colors['tertiary'] && `/ ${colors['tertiary']}`}</div>}
                    {status && <div> Status : {status}</div>}
                    {tags && <div> Tags : {tags.join(', ')}</div>}
                    <div style={{ marginTop: '1rem', fontWeight: 'bold' }}> Contact Info </div>
                    {contact?.email && <div> Email : {contact['email']}</div>}
                    {contact?.phone && <div> Phone : {contact['phone']}</div>}
                    {contact?.address?.address1 && <div> Address1 : {contact['address']['address1']}</div>}
                    {contact?.address?.address2 && <div> Address2 : {contact['address']['address2']}</div>}
                    {contact?.address?.city && <div> City : {contact['address']['city']}</div>}
                    {contact?.address?.state && <div> State : {contact['address']['state']}</div>}
                    {contact?.address?.postcode && <div> Postcode : {contact['address']['postcode']}</div>}
                    {attributes?.spayed_neutered !== undefined && <div> Spayed/Neutered : {attributes['spayed_neutered'] ? 'Yes' : 'No'}</div>}
                    {gender && <div> Coat Length : {gender}</div>}

                </ModalDescription>
            </ModalContent>
            <ModalActions>
                <Button color='black' onClick={() => toggleOpen(false)}>
                    Done
                </Button>

            </ModalActions>
        </Modal >
    )
}

export default DetailsModal
